import CircularProgress from '@mui/material/CircularProgress';
const Loading = () => {

    return (
        <>
            <>
                <div className={"globalLoadingBackground"}>
                </div>
                <div className={"globalLoadingIcon"}>
                    <div className={"iconArea"}>
                        <CircularProgress />
                    </div>
                </div>
            </>
        </>
    )
}
export default Loading;
